import { toast } from 'react-toastify'
import ItemListContainer from './ItemListContainer'
import ItemDetailContainer from './ItemDetailContainer'



const Main = ({ nombre, apellido }) => {

	const handleToast = () => {
		toast.warn('Hello, you are toasted!!')
		console.log('Hello, you are toasted!!')
	}

	return (
		<>
			<button onClick={handleToast}>Toast me</button>
			<h2>Bienvendido {nombre} {apellido}</h2>
			<ItemListContainer />
			<ItemDetailContainer />
		</>
	)
}

export default Main
